    display: flex;
    justify-content: space-between;
`;

const StyledForm = styled.div`
    display: flex;
    flex-direction: column;
    max-width: 300px;
    margin-top: 2rem;
    select,
    input{
        padding: 7px;
        min-height: 30px;
        outline: none;
        border-radius: 5px;
        border: 1px solid rgb(182,182,182);
    }
`;

